// Import product images
import health from './path/to/health.png';
import fur1 from './path/to/fur1.png';
import fur3 from './path/to/fur3.png';
import fur6 from './path/to/fur6.png';




// Array of product details
const all_products = [
  {
    id: 1,
    name: "Fitness Tracker Smartwatch",
    category: "electronics",
    image: health,
    new_price: 150.0,
    old_price: 200.0,
  },
  {
    id: 2,
    name: "Modern Sofa Set",
    category: "furniture",
    image: fur1,
    new_price: 500.0,
    old_price: 650.0,
  },
  {
    id: 3,
    name: "Dining Table Set",
    category: "furniture",
    image: fur3,
    new_price: 300.0,
    old_price: 450.0,
  },
  {
    id: 4,
    name: "Office Chair",
    category: "furniture",
    image: fur6,
    new_price: 120.0,
    old_price: 200.0,
  },
];

export default all_products;
